import React from 'react';
import { useLocation } from 'react-router-dom';

const SearchResultPage = () => {
  const location = useLocation();
  const { rooms, searchDetails } = location.state || {};

  return (
    <div className="px-6 py-4">
      <h2 className="text-2xl font-bold mb-4">Search Results</h2>
      <p>
        <strong>Check-in:</strong> {searchDetails?.checkIn} &nbsp;
        <strong>Check-out:</strong> {searchDetails?.checkOut} &nbsp;
        <strong>Room Type:</strong> {searchDetails?.roomType}
      </p>

      {rooms?.length ? (
        <div className="grid gap-4 mt-4">
          {rooms.map((room) => (
            <div key={room.id} className="border p-4 rounded shadow">
              <h3 className="font-semibold">{room.roomType} Room</h3>
              <p>Price: â‚¹{room.price}</p>
              <p>Capacity: {room.capacity} guests</p>
              {/* Add more room details if needed */}
            </div>
          ))}
        </div>
      ) : (
        <p>No rooms found.</p>
      )}
    </div>
  );
};

export default SearchResultPage;
